import React, { Component } from "react";
import { connect } from "react-redux";

import CartItem from "./CartItem";

const mapStateToProps = (state) => {
  return {
    activeCalendar: state.activeCalendar,
  };
};

class Cart extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    if (this.props.activeCalendar) {
      console.log(this.props.activeCalendar.sections);
      return (
        <div className="w-1/5 h-full bg-black">
          {this.props.activeCalendar.sections.map((item, key) => {
            <p className="text-white w-full h-full">{item.title}</p>;
          })}
        </div>
      );
    }
  }
}

export default connect(mapStateToProps)(Cart);
